import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open cart modal
    await page.waitForSelector('.cart', { timeout: 5000 });
    await page.click('.cart');

    // Wait for cart modal to appear
    await page.waitForSelector('#cartModal', { timeout: 5000 });

    // Take screenshot of cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_open.png'));

    // Update quantity to 3 by clicking the plus button twice
    await page.waitForSelector('.cart-item:first-child .cart-item-quantity .quantity-btn:last-child', { timeout: 5000 });
    await page.click('.cart-item:first-child .cart-item-quantity .quantity-btn:last-child');
    await page.click('.cart-item:first-child .cart-item-quantity .quantity-btn:last-child');

    // Wait for quantity to update
    await page.waitForFunction(() => {
      const quantity = document.querySelector('.cart-item:first-child .quantity');
      return quantity && quantity.textContent === '3';
    }, { timeout: 5000 });

    // Take screenshot of updated cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_quantity_updated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_quantity_updated.png'));

    // Extract updated quantity
    const updatedQuantity = await page.$eval('.cart-item:first-child .quantity', el => el.textContent);
    const itemName = await page.$eval('.cart-item:first-child .cart-item-title', el => el.textContent);

    return {
      success: true,
      action: "Updated cart item quantity from 1 to 3",
      extractedData: {
        itemName,
        updatedQuantity
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to update cart item quantity",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
